Here's a JavaScript function that takes a sentence as input and returns a new string with the order of adjectives reversed:

```javascript
function reverseAdjectives(sentence) {
  // Split the sentence into an array of words
  const words = sentence.split(" ");

  // Find all the indexes of adjectives (words that contain only letters and end in 'y', 'e', or 'ies')
  const adjectiveIndexes = [];
  for (let I = 0; I < words.length; i++) {
    const word = words[i];
    let lastLetter = word[word.length - 1];
    if (/[a-z]/.test(lastLetter) && (lastLetter === 'y' || lastLetter === 'e' || lastLetter === 'ies')) {
      adjectiveIndexes.push(i);
    }
  }

  // Reverse the order of the adjectives
  const reversedAdjectives = adjectiveIndexes.reduceRight((accumulator, currentValue) => {
    const word = words[currentValue];
    const position = accumulator.length;
    return [...accumulator, ...word.split("").reverse().join("").split(" "), ...words.slice(currentValue + 1)];
  }, []);

  // Combine the reversed adjectives with the rest of the words
  const result = [words.slice(0, Math.min(...adjectiveIndexes))].concat(reversedAdjectives).concat(words.slice(Math.max(...adjectiveIndexes)) + 1));

  // Join the words back into a sentence
  return result.join(" ");
}

// Example usage
