]

func replaceHomophones(_ text: String) -> String {
    var result = ""
    for (i, char) in text.enumerated() {
        let currentWordStartIndex = i
        while I < text.endIndex && !text[i].isWhitespace {
            I += 1
        }
        let wordEndIndex = I
        let word = String(text[currentWordStartIndex..<wordEndIndex])
        let correctedWord = replaceHomophonesInWord(word)
        result.append(contentsOf: String(char))
        result.append(contentsOf: correctedWord)
        while I <= wordEndIndex && text[i].isWhitespace {
            I += 1
        }
    }
    return result
}

func replaceHomophonesInWord(_ word: String) -> String {
    var result = ""
    for homophone in homophones {
        result = result.replacingOccurrences(of: homophone.incorrect, with: homophone.correct, options: .regularExpression)
    }
    return result == word ? word : result
}

