2. Open the newly generated migration file (`database/migrations/{timestamp}_add_cars_pets_and_house_to_users.php`) and add the following code inside the up() method:

```php
public function up()
{
    Schema::table('users', function (Blueprint $table) {
        $table->hasMany('cars')->withTimestamps();
        $table->hasMany('pets')->withTimestamps();
        $table->hasOne('house');
    });

    Schema::create('houses', function (Blueprint $table) {
        $table->id();
        $table->foreignIdFor(User::class)->constrained()->onDelete('cascade');
        $table->string('address')->nullable();
        $table->timestamps();
    });
}
```

In this migration, we're adding three relationships to the `users` table:

- `$table->hasMany('cars')` creates a `belongsToMany` relationship between `User` and `Car`, allowing each user to have multiple cars.
- `$table->hasMany('pets')` creates another `belongsToMany` relationship between `User` and `Pet`, allowing each user to have multiple pets.
- `$table->hasOne('house')` creates a `hasOne` relationship between `User` and `House`, allowing each user to have only one house.

We also created a new table called `houses` to store the address of the user's house. The foreign key `house.user_id` is constrained to the primary key `users.id`.

3. Save the migration file and run it using the `up()` command.

