To retrieve the username from the JWT (JSON Web Token) in an ASP.NET C# WebAPI, you can follow these steps:

1. Install the `Microsoft.IdentityModel.Tokens` package via NuGet to your project.

2. In your WebAPI controller, create a method to retrieve the username from the JWT token. Here's an example:

```csharp
using Microsoft.IdentityModel.Tokens;

[Route("api/[controller]")]
[ApiController]
public class MyController : ControllerBase
{
    private readonly IConfiguration _configuration;

    public MyController(IConfiguration configuration)
    {
        _configuration = configuration;
    }

    [HttpGet]
    [Route("getusernamefromjwt")]
    public string GetUsernameFromJWT()
    {
        // Get the Authorization header from the request
        var authHeader = Request.Headers["Authorization"];

        // Split the header into two parts separated by a space
        if (!string.IsNullOrWhiteSpace(authHeader))
        {
            var parts = authHeader.Split(" ", StringSplitOptions.RemoveEmptyEntries);

            // Check if the first part is "Bearer"
            if (parts[0].Equals("Bearer", StringComparison.OrdinalIgnoreCase))
            {
                // Remove the "Bearer " prefix and decode the token
                var token = parts[1];
                var securityKey = new SymmetricSecurityKey(Encoding.UTF8.GetBytes(_configuration["JwtSettings:Secret"]));
                var credentials = new SigningCredentials(securityKey, SecurityAlgorithms.HmacSha256Signature);
                var tokenHandler = new JwtSecurityTokenHandler();
                var jwtSecurityToken = tokenHandler.ReadJwtToken(token);

                // Extract the username from the claims
                return jwtSecurityToken.Claims.FirstOrDefault(x => x.Type == ClaimTypes.Name)?.Value;
            }
        }

        // Return null if the authorization header is missing or invalid
        return null;
    }
}
```

