To move n disks, we need a temporary rod (D) to store the smaller disks while we move the larger one. We follow these steps:
1. Move the n-1 smaller disks from the source rod (A) to the temporary rod (D), using the destination rod (C) as an intermediate rod.
2. Move the largest disk (disk of size 3) from the source rod (A) to the destination rod (C).
3. Move the n-1 smaller disks from the temporary rod (D) back to the destination rod (C), using the source rod (A) as an intermediate rod.

Here's how we implement the algorithm in Java:

