Here's the R code to check if all non-NA elements in a character vector can be converted to numeric:

```r
is_numeric <- function(x) {
  tryCatch(
    as.numeric(x),
    error = function(e) NA,
    warning = function(w) NA
  )
}

all_numeric <- function(x) {
  !any(is.na(x) | !all(is_numeric(x[!is.na(x)])) )
}

# Example usage
my_vector <- c("1", "2.5", "3", "4", "NA", "5", "6")
if (all_numeric(my_vector)) {
  print("All elements of my_vector can be converted to numeric.")
} else {
  print("Not all elements of my_vector can be converted to numeric.")
}
```

The `is_numeric()` function takes a vector `x` and returns either its numeric equivalent (using `as.numeric()`) or an `NA` value if there's an error or warning while converting it. The `all_numeric()` function then checks whether all non-NA elements in `x` (after removing any NAs) can be converted to numeric using `is_numeric()`. The final result is negated because we want `TRUE` for all elements being numeric instead of `FALSE` for none being numeric.

Note that this solution uses `tryCatch()` to handle errors and warnings that might occur during conversion, so you don't have to worry about these cases causing issues.

