import { Injectable, NestMiddleware } from '@nestjs/common';
import { ExecutionContext, UnauthorizedException } from '@nestjs/core';

@Injectable()
export class DevelopmentModeMiddleware implements NestMiddleware {
  use(context: ExecutionContext, next: () => any): any {
    const req = context.switchToHttp().getRequest();
    const isDevelopmentMode = req.app.get('env') === 'development';

    if (isDevelopmentMode) {
      return next();
    }

    throw new UnauthorizedException('Access denied in production mode');
  }
}
