Here's a PowerShell script that recursively checks folders and subfolders for ACLs with SIDs found only in the SIDHistory of users or groups in the domain:

```powershell
# Define function to check if SID is in SIDHistory
function CheckSIDInSIDHistory {
    param(
        [string]$sid
    )

    $domain = (Get-ADDomain).Name
    $sidObj = New-Object -ComObject 'Security.Principal.NTAccount'
    $sidObj.BuildSID($sid)
    $principal = [System.Security.Principal.SecurityIdentifier]::Parse($sid)
    $history = $principal.Translate([System.Security.Principal.SecurityIdentifier])

    # Search AD for principal with matching SIDHistory
    $searcher = New-Object -ComObject "ADSI.Searcher"
    $filter = "(sIDHistory=$history)"
    $results = $searcher.FindAll($filter, "user")

    return ($results.Count -gt 0)
}

# Function to check ACL for SIDHistory matches
function CheckACLForSIDHistory {
    param(
        [string]$path
    )

    $acl = Get-Acl $path
    foreach ($access in $acl.Access) {
        $sid = $access.IdentityReference
        if (-not ([security.principal.ntaccount]::IsWellKnownGroup($sid))) {
            if (CheckSIDInSIDHistory($sid)) {
                Write-Host "$path contains an ACL with SID in SIDHistory"
            }
        }
    }
}

# Recursive function to traverse folder tree
function TraverseFolderTree {
    param(
        [string]$folderPath
    )

    Get-ChildItem $folderPath -Recurse | Where-Object {$_.Mode -band [IO.FileMode]::Directory} | % {
        TraverseFolderTree $_.FullName
        CheckACLForSIDHistory $_.FullName
    }
}

# Main execution
TraverseFolderTree "C:\SomeFolderPath"
```

